import React from 'react';
import { getLanguagesNames } from '../../translations/Languages';
import { LanguagesContainer, LanguageButton } from '../../styles/styles';
import { useTranslation } from 'react-i18next';

const Language = ({ actualLanguage, changeLanguage }) => {
	const { t, i18n } = useTranslation();
	const languages = getLanguagesNames().filter((language) => language.key !== actualLanguage);
	console.log(Object.entries('languages', { returnObjects: true }));
	return (
		<LanguagesContainer>
			{Object.values('languages', { returnObjects: true }).map((language) => (
				<LanguageButton
					key={language.key}
					onClick={() => {
						changeLanguage(language.key);
					}}>
					{language.name}
				</LanguageButton>
			))}
		</LanguagesContainer>
	);
};

export default Language;
